// Fichier Contenant toutes les constantes utiliss pour le test des champs
// rentrs par l'utilisateur

module.exports = {
// User Edit
  "formatLienLinkedIn": /^https?:\/\/(?:www\.)?linkedin.com\/in\/[a-zA-Z0-9]/,
  // Capture les numros de tlphones selon la norme E.164 (prfixe dun plus suivi du code national et sans caractres parasites (espaces, points, tirets))
  "formatNumroTlphone": /^\+[1-9][0-9]{1,14}$/,
  // Adresses I18N UTF8
  "formatAdresseMl": /^[a-zA-Z\p{Alphabetic}0-9.!#$%&'*+=?^_`{|}~-]+@[a-zA-Z\p{Alphabetic}0-9](?:[a-zA-Z\p{Alphabetic}0-9]{0,61}[a-zA-Z\p{Alphabetic}0-9])?(?:\.[a-zA-Z\p{Alphabetic}0-9](?:[a-zA-Z\p{Alphabetic}0-9]{0,61}[a-zA-Z\p{Alphabetic}0-9])?)+$/u,

}
